import React, { useState, useEffect } from 'react';
import logo from './logo.svg';


function Dd() {
    const [virus,setVirus,bact,setBact,time, setTime] = useState(0)

    useEffect(() => {
        fetch('/bebe').then(res => res.json()).then(data => {
            setTime(data.normal)
            setBact(data.bakteri)
            setVirus(data.vrs)
        })
    }, [])

    return (
        <div>
            Normal Değer = {time}
            Bakteri ={bact}
            Virüs ={virus}
        </div>
    );
}

export default Dd;
